import './App.css';
import { Route,Routes } from 'react-router-dom';
import {Home} from './components/pages/Home/Home'

function App() {

  return (
    <div>
      <Routes>
        <Route path="/" element = {<Home/>} className/>
        <Route path='/home' element = {<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
